import React from 'react';
import { useTheme } from "../context/ThemeContext";

const Logo = ({ size = 60 }) => {
  const { theme } = useTheme();
  
  return (
    <div 
      style={{
        position: "relative",
        width: `${size}px`,
        height: `${size * 0.67}px`,
        cursor: "pointer",
        transformOrigin: "bottom",
        perspective: "1500px",
        zIndex: 50
      }}
      onMouseEnter={(e) => {
        e.currentTarget.style.transform = "rotateX(-20deg)";
        e.currentTarget.style.boxShadow = `0 20px 40px rgba(0,0,0,0.2)`;
      }}
      onMouseLeave={(e) => {
        e.currentTarget.style.transform = "rotateX(0deg)";
        e.currentTarget.style.boxShadow = "none";
      }}
    >
      {/* Main file body */}
      <div style={{
        position: "relative",
        width: "100%",
        height: "100%",
        background: theme.accent,
        borderRadius: "16px",
        borderTopLeftRadius: "0",
        boxShadow: "0 8px 20px rgba(0, 0, 0, 0.2)",
        transition: "all 0.3s ease"
      }}>
        {/* Top tab */}
        <div style={{
          position: "absolute",
          bottom: "99%",
          left: 0,
          width: "33%",
          height: "10%",
          background: theme.accent,
          borderTopLeftRadius: "16px",
          borderTopRightRadius: "16px"
        }} />
        
        {/* Top corner */}
        <div style={{
          position: "absolute",
          top: "-15px",
          left: "75.5%",
          width: "6.7%",
          height: "10%",
          background: theme.accent,
          clipPath: "polygon(0 35%, 0% 100%, 50% 100%)"
        }} />
      </div>
      
      {/* Paper layers */}
      <div style={{
        position: "absolute",
        inset: "4px",
        background: theme.surfaceSecondary,
        borderRadius: "12px",
        transition: "all 0.3s ease",
        transformOrigin: "bottom"
      }} />
      
      <div style={{
        position: "absolute",
        inset: "8px",
        background: theme.surfaceTertiary,
        borderRadius: "8px",
        transition: "all 0.3s ease",
        transformOrigin: "bottom"
      }} />
      
      <div style={{
        position: "absolute",
        inset: "12px",
        background: theme.cardBackground,
        borderRadius: "4px",
        transition: "all 0.3s ease",
        transformOrigin: "bottom"
      }} />
      
      {/* Bottom gradient layer with SetPad text */}
      <div style={{
        position: "absolute",
        bottom: 0,
        background: `linear-gradient(to top, ${theme.accent}, ${theme.accentHover})`,
        width: "100%",
        height: "78%",
        borderRadius: "16px",
        borderTopRightRadius: "0",
        transition: "all 0.3s ease",
        transformOrigin: "bottom",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        boxShadow: `inset 0 10px 20px ${theme.accentHover}, inset 0 -10px 20px ${theme.accent}`
      }}>
        <span style={{
          color: "#fff",
          fontSize: `${size * 0.15}px`,
          fontWeight: "700",
          textAlign: "center",
          lineHeight: 1,
          textShadow: "0 1px 2px rgba(0,0,0,0.3)"
        }}>
          SetPad
        </span>
        
        {/* Right tab */}
        <div style={{
          position: "absolute",
          bottom: "99%",
          right: 0,
          width: "73%",
          height: "4%",
          background: theme.accentHover,
          borderTopLeftRadius: "16px",
          borderTopRightRadius: "16px"
        }} />
        
        {/* Right corner */}
        <div style={{
          position: "absolute",
          top: "-10px",
          right: "71%",
          width: "5%",
          height: "7.5%",
          background: theme.accentHover,
          clipPath: "polygon(100% 14%, 50% 100%, 100% 100%)"
        }} />
      </div>
    </div>
  );
};

export default Logo;
